INSERT INTO news (id, title, summary, content, image, category, author, "createdAt", "updatedAt") VALUES ('N1767498803672', 'Làm giàu trên quê hương cách mạng', 'Bài báo được viết bởi Đại Biểu Nhân Dân Tỉnh Nghệ An', '<article class="article-detail">
            <header>
                                                <h1 class="post-title title title-1">Làm giàu trên quê hương cách mạng                                    </h1>
                <div class="actions float-right">
    </div>            </header>
            <div class="post-meta">
                <div class="post-date">
                    <i class="fa fa-clock-o"></i>
                    10/02/2025 lúc 14:00 (GMT)
                    <!-- - 1071 lượt xem -->
                </div>
            </div>
            <div class="sapo title-2 font-bold mt-3 mb-3">Từ nhiều năm nay mỗi lúc nhắc đến Hạnh Lâm- một trong những cái nôi cách mạng của huyện Thanh Chương mọi người đều có ấn tượng về một vùng đất năng động, phát triển. Đây là xã vùng cao biên giới đầu tiên của tỉnh Nghệ An được công nhận “đạt chuẩn Nông thôn mới”. Trong thành tích chung đó có sự đóng góp không nhỏ của nhiều cá nhân, hộ gia đình. Trong đó gia đình ông bà: Hà Hữu Ngọc- Nguyễn Thị Hường ở xóm 3 là một ví dụ.</div>
                        
            <div id="post_content" class="post-content">
                                    <figure class="image "><img src="	https://dbndnghean.vn/dbndna-media/25/2/17/lam-giau-tren-que-huong-cach-mang.jpg" alt="" width="1280" height="720">
<figcaption>Toàn cảnh trang trại của gia đình Hường- Ngọc</figcaption>
</figure>
<p style="text-align: justify;">Ông Hà Hữu Ngọc và bà Nguyễn Thị Hương cùng sinh năm 1976 tại xóm 3 xã Thanh Đức. Sinh ra trong những gia đình nông dân nghèo ở một xã vùng cao xa trung tâm nên cả ông Ngọc và bà Hường chỉ học hết bậc THCS và cũng không giống với bạn bè cùng trang lứa rời quê đi làm ăn xa họ đã kết hôn vào năm 1995 và quyết định lập thân lập nghiệp ngay chính trên mảnh đất quê hương. Bà Hường cho biết khi quyết định lập nghiệp tại quê nhà dù chưa có vốn nhưng vợ chồng đã quyết định vay mượn mua gom đất đồi rừng để đầu tư vào việc trồng keo và cây ăn quả. Sau 2 năm tích cực gom đất, vợ chồng đã gom được 20 ha liền vùng liền thửa ở gần nhà tiện lợi cho việc sản xuất, thâm canh. Nói là sản xuất nhưng ở giai đoạn đầu toàn bộ 20 ha đất này chỉ được trồng keo. Sau khi thu hoạch 3 lứa (5 năm một lứa) với tổng thu nhập trên 4 tỷ đồng, từ năm 2016, khi xã và huyện có chủ trương hỗ trợ nông dân trồng cây ăn quả, vợ chồng ông đã quyết định chọn vùng đất tốt nhất để chuyển đổi từ keo sang trồng cam, bưởi. Được sự giúp đỡ về nguồn vốn, KHKT và cây giống, ông Ngọc và bà Hường đã đầu tư trồng 5 ha cam các loại, chủ yếu là Xã Đoài, V2 chín muộn, 0,5 cam bù bản địa, 0,5 ha bưởi, 0,5 ha quýt.</p>
<figure class="image "><img src="https://dbndnghean.vn/dbndna-media/25/2/17/lam-giau-tren-que-huong-cach-mang--n1.jpg" alt="" width="1280" height="960">
<figcaption>Ông Nguyễn Văn Đệ- Phó Chủ tịch UBND tỉnh Nghệ An và lãnh đạo Sở Nông nghiệp &amp;PTNT thăm vườn cam của gia đình Ông Ngọc- Bà Hường</figcaption>
</figure>
<p style="text-align: justify;">Sau giai đoạn kiến thiết cơ bản đầu tư chăm bón, bắt đầu từ năm 2019 các loại cam, bưởi đã bắt đầu cho thu hoạch. Vụ đầu chỉ được 50 triệu đồng, từ các năm sau doanh thu được nâng lên, năm 2022 đạt 500 triệu đồng, năm 2023 đã thu về trên 1 tỷ đồng, năm 2024 này đạt trên 1,5 tỷ đồng sau khi trừ các chi phí.</p>
<figure class="image "><img src="https://dbndnghean.vn/dbndna-media/25/2/17/lam-giau-tren-que-huong-cach-mang--n2.jpg" alt="" width="1276" height="956">
<figcaption>Ông Trình Văn Nhã - P. Bí thư Huyện ủy, Chủ tịch UBND huyện và các đồng chí lãnh đạo UBND, Hội nông dân huyện kiểm tra đánh giấ chất lượng mô hình cam hữu cơ của Ông Ngọc- Bà Hường</figcaption>
</figure>
<p style="text-align: justify;">Nét đáng chú ý nhất trong quá trình trồng chăm sóc cam và các loại cây ăn quả khác của vợ chồng ông Ngọc là phải tuân thủ nghiêm ngặt các yêu cầu về KHKT và cây giống.&nbsp; Đó là cây giống phải đảm bảo nguồn gốc, đạt tiêu chuẩn. Bởi từ khi trồng đến lúc cho quả phải mất từ 3-4 năm, nếu cây giống không chuẩn sẽ rất lãng phí tài nguyên đất đai, công sức, thời gian. Ngoài cây giống phải bón các loại phân có chất lượng, bón đúng thời điểm. Ngoài phân còn phải làm tốt việc phòng trừ sâu bệnh. Để đảm bảo được các yêu cầu này, ông bà đã liên kết với Học viên Nông nghiệp Việt nam lấy giống từ gốc, có bảo hành và lấy các loại phân bón, chế phẩm như nấm xanh, nấm trắng để cải tạo đất và phòng trừ sâu bệnh, tiến tới liên kết thực hiên kỹ thuật trồng cam hữu cơ. Nhờ vậy nên Học viện Nông nghiệp Việt Nam đã thường xuyên cử chuyên gia, kỹ thuật viên hỗ trợ gia đình trong quá trình trồng, chăm sóc, thu hoạch cam và phối hợp với Hội nông dân huyện, xã đăng ký nhãn hiệu, giới thiệu, bao tiêu sản phẩm cho vườn cam. Từ cách làm của vợ chồng ông Ngọc hiện tại ở Hạnh Lâm và Thanh Đức đã có hàng chục hộ trồng cam theo mô hình liên kết này.</p>
<figure class="image "><img src="https://dbndnghean.vn/dbndna-media/25/2/17/lam-giau-tren-que-huong-cach-mang--n3.jpg" alt="" width="1280" height="830">
<figcaption>Lễ công bố Cam Ngọc Hường được công nhận là cam hữu cơ</figcaption>
</figure>
<p style="text-align: justify;">Ngoài việc tuân thủ các yêu cầu về phòng trừ sâu bệnh theo quy trình, hướng dẫn của Học viện Nông nghiệp Việt Nam, căn cứ vào tình hình thực tế tại địa phương, những năm gần đây vợ chồng ông Ngọc và nhiều hộ trồng cam ở đây còn học hỏi kinh nghiệm của những người đi trước chế ra các chế phẩm sinh học để bón cho cây như ngâm ủ chuối chín với dung dịch Tricodema phun vào gốc để quả cam thơm và ngọt hơn, chế phẩm phân chuống ủ với vỏ lạc cho đất tơi xốp hơn và bọc bao cho trái, mắc màn cho cây để phòng trừ các loại côn trùng chích hút. Bởi nếu phun thuốc sẽ ảnh hưởng đến vệ sinh an toàn thực phẩm sản phẩm sẽ bị thị trường bài xích, khó tiêu thụ.</p>
<p style="text-align: justify;">Một nét đáng chú ý nữa ở trang trại ông Ngọc, bà Hường là ngoài việc làm giàu cho bản thân, ông bà còn tạo điều kiện làm việc cho nhiều người khác. Bà Hường cho biết, ông bà đã thuê 2 nhân công làm việc thường xuyên, vào các thời điểm bón phân, bọc quả và thu hoạch thuê thêm từ 5- 10 lao động khác với mức lương từ 250- 300 000 đồng/ ngày/ người.</p>
<p style="text-align: justify;">Bên cạnh việc đầu tư sản xuất, ông Ngọc và bà Hường cũng chăm lo cho gia đình. Họ có hai người con, một trai, một gái, và cả hai đều đã trưởng thành. Gia đình đã mua đất và xây nhà mới tại thị tứ Hạnh Lâm để nâng cao chất lượng cuộc sống.</p>
<figure class="image "><img src="https://dbndnghean.vn/dbndna-media/25/2/17/lam-giau-tren-que-huong-cach-mang--n4.jpg" alt="" width="1280" height="812">
<figcaption>Vườn cam Hường- Ngọc trở thành điểm Chekin yêu thích của nhiều du khách</figcaption>
</figure>
<p style="text-align: justify;">Từ kết quả sản xuất các loại cây ăn quả cho thu nhập cao và chăm lo cuộc sống gia đình những năm gần đây vợ chồng ông Ngọc- Bà Hường đã được nhiều người biết đến, liên tục được Hội Nông dân huyện xã công nhận là Hội viên sản xuất giỏi; được UBND huyện, xã tặng thưởng nhiều Giấy khen và công nhận là hộ gia đình tiêu biểu trong các phong trào thi đua. Gia đình văn hóa nhiều năm liền. Vườn cam của gia đình cũng được các đồng chí lãnh đạo UBND tỉnh, Huyện uy- UBND huyện đến thăm nhiều lần; được cán bộ, Nhân dân và du khách gần xa đến tham quan, học hỏi. Bà Nguyễn Thị Hường vừa được&nbsp; MTTQ Việt Nam huyện Thanh Chương suy tôn, chọn cử làm Ủy viên Ủy ban MTTQ huyện nhiệm kỳ 2024- 2029.</p>
<figure class="image "><img src="https://dbndnghean.vn/dbndna-media/25/2/17/lam-giau-tren-que-huong-cach-mang--n5.jpg" alt="" width="1276" height="956">
<figcaption>Phân loại cam trước lúc chuyển đi các đại lý</figcaption>
</figure>
<p style="text-align: justify;">Rời trang trại của ông Ngọc - bà Hường vào một buổi chiều giữa mùa đông, đi trên những triền đồi bát ngát cây xanh bất chợt tôi nhớ đến nhạc sỹ Văn Thế&nbsp; và&nbsp; một đoạn ca từ trong ca khúc “Nhớ Thanh Chương”: đất cũ năm xưa nay bát ngát cam chè. Nhạc sỹ giải thích: đất cũ là muốn nói đến đất cách mạng, còn bát ngát cam chè là nói về sự phát triển của Hạnh Lâm hôm nay. Vâng, Hạnh Lâm là đất cách mạng một trong 3 địa phương đầu tiên của huyện có Chi bộ Đảng (cùng Xuân Tường và Võ Liệt) và ngày 01/5/1930 Chi bộ đã lãnh đạo hàng ngàn nông dân vùng lên đốt phá đồn điền Ký Viễn, lấy gan vàng chọi đạn sắt suốt mấy ngày đêm ở Đình Làng Thượng, cùng với công nhân Trường Thi- Bến Thủy mở đầu đầu cho cao trào Xô viết Nghệ Tĩnh 1930- 1931…Chè Hạnh Lâm đã bắt đầu sinh sôi từ năm 1968 khi tỉnh mở Nông trường Hạnh Lâm, còn hôm nay gia đình ông Ngọc – bà Hường đang cùng các công nhân của nông trường, các đội viên của Tổng đội 2 (trước đây) và người dân Hạnh Lâm, Thanh Đức biến mảnh đất cách mạng nơi vùng cao biên giới thành một vùng đất năng động và giàu có.</p>                            </div>            
